(function() {
  $(function() {
    var draw;
    draw = function(btn, box, id) {
      if (box.css('left') === '-282px') {
        box.animate({
          left: 0
        }, 300);
        btn.animate({
          left: 280
        }, 300);
        return $('.noty-content .panel-collapse').each(function() {
          console.log($(this).attr('id'));
          if ($(this).attr('id') === id && !$(this).hasClass('in')) {
            $(this).collapse('toggle');
          }
          if ($(this).hasClass('in')) {
            return $(this).collapse('toggle');
          }
        });
      } else {
        box.animate({
          left: -282
        }, 300);
        return btn.animate({
          left: 280
        }, 300);
      }
    };
    $('.original-news').click(function() {
      return draw($(this).parent(), $(this).parent().parent(), 'collapse-01');
    });
    $('.facebook').click(function() {
      return draw($(this).parent(), $(this).parent().parent(), 'collapse-02');
    });
    return $('.twitter').click(function() {
      return draw($(this).parent(), $(this).parent().parent(), 'collapse-03');
    });
  });

}).call(this);
